import { Component } from "react";
import './card.component.css'

class Card extends Component {
    render(){
        const {items} = this.props
        return(
            <div className="monster-container-main">
                {items.map((item)=>(
                <div key={item.id} className="monster-container-items">
                    <img alt={`monsters name is ${item.name}`} src={`https://robohash.org/${item.id}?set=set1&size=180x180`} />
                    <h1>{item.name}</h1>
                    <h2>{item.email}</h2>
                    <h3>{item.website}</h3>
                </div>
            ))}
            </div>
        )
    }
}

export default Card
